import React from "react";
import { connect } from "react-redux";
import { useParams } from "react-router";
import {getDogID} from '../../actions'

export function Detail(props){

    const {id} = useParams(); 

    React.useEffect(()=>{
        if (props.detalle === null) props.getDog(id)

    })

    return (
        <div className="detail">
            <h1>{props.detalle.name}</h1>
            {props.detalle.image? <img src={props.detalle.image.url}></img>: <span>No hay foto</span>}
            {props.detalle.weigth? <div>Peso aproximado: {props.detalle.weigth.metric}</div>: props.detalle.peso?<div>Peso aproximado: {props.detalle.peso}</div>: <span>sin datos de peso</span>}
            {props.detalle.height? <div>Altura aproximado: {props.detalle.height.metric}</div>: props.detalle.altura?<div>Altura aproximado: {props.detalle.altura}</div>: <span>sin datos de altura</span>}
            {props.detalle.life_span? <div>Vida aproximada: {props.detalle.life_span}</div>: props.detalle.añosvida?<div>Vida aproximada: {props.detalle.añosvida}</div>: <span>sin datos de vida</span>}
            {props.detalle.temperament? <div>Temperamento: {props.detalle.temperament}</div>: props.detalle.temperamentos?<div>Temperamentos {props.detalle.temperamentos.toString()}</div>: <span>sin datos de temperamento</span>}

        </div>
    )
}
const mapStateToProps = state => {
    return {
        detalle: state.detalle,
    }
}

const mapDispatchToProps = (dispatch) => {
    return {
        getDog: (id)=>dispatch(getDogID(id)),
    }
}

export default connect (mapStateToProps,mapDispatchToProps)(Detail)
